import { useState, useEffect } from "react";
import "./Skill.css";
import Loading from "../Loading/Loading";

function Skill() {
  const [skillLoading, setSkillLoading] = useState(true);
  const [techs, setTechs] = useState([]);

  useEffect(() => {
    fetch("https://reitos.pythonanywhere.com/api/technology_categories/")
      .then((r) => r.json())
      .then((data) => setTechs(data));
  }, []);

  const insertTech = (techs) => {
    if (!techs) return;
    return techs.map((tech) => {
      return (
        <div className="list">
          <label>{tech.name}</label>
          <img src={tech.tech_thumbnail} />
        </div>
      );
    });
  };

  return (
    <>
      {skillLoading ? (
        <Loading
          title="Skills"
          setLoading={setSkillLoading}
          loading={skillLoading}
        />
      ) : (
        <section id="skill" className="skill section">
          <div className="skill__container container">
            <div className="skill__title__container">
              <h1 className="blog__title">
                <span aria-hidden="true">02</span>Skills
              </h1>
            </div>
            <div className="skill__content grid">
              <div className="set">
                <span className="fa-solid fa-globe"></span>
                <header>Frontend Technology</header>
              </div>
              <div className="set">
                <span class="fa-solid fa-screwdriver-wrench"></span>
                <header>Backend Technology</header>
                <div className="list">
                  <label>Python</label>
                  <i class="fa-brands fa-python"></i>
                </div>
                <div className="list">
                  <label>Ruby</label>
                  <i class="fa-brands fa-python"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>Django</label>
                  <i class="fa-brands fa-square-js"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>Ruby on Rails</label>
                  <i class="fa-brands fa-python"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>SQL</label>
                  <i class="fa-brands fa-css3-alt"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>PostgreSQL</label>
                  <i class="fa-brands fa-square-js"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>SQLite</label>
                  <i class="fa-brands fa-python"></i>
                  {/* need to be updated*/}
                </div>
              </div>
              <div className="set">
                <span class="fa-regular fa-comment-dots"></span>
                <header>Other Technology</header>
                <div className="list">
                  <label>RESTful API</label>
                  <i class="fa-brands fa-bootstrap"></i>
                  {/* need to be updated*/}
                </div>
                <div className="list">
                  <label>Git</label>
                  <i class="fa-brands fa-git"></i>
                </div>
                <div className="list">
                  <label>GitHub</label>
                  <i class="fa-brands fa-github"></i>
                </div>
                <div className="list">
                  <label>Heroku</label>
                  <i class="fa-brands fa-github"></i>
                  {/* need to be updated*/}
                </div>
              </div>
            </div>
          </div>
        </section>
      )}
    </>
  );
}

export default Skill;
